import React from 'react';
import { Link } from 'react-router-dom';
import Navbar from '../components/Navbar';

const NotFound = () => {
  return (
    <div className="min-h-screen flex flex-col">
      <Navbar />
      
      <div className="flex-grow flex items-center justify-center py-12">
        <div className="text-center max-w-lg mx-auto px-4">
          <h1 className="text-9xl font-bold text-primary-200">404</h1>
          <h2 className="text-3xl font-bold mb-4 text-neutral-800">Page Not Found</h2>
          <p className="text-neutral-600 mb-8">
            The page you're looking for doesn't exist or has been moved.
          </p>
          <Link to="/" className="btn-primary">
            Return Home
          </Link>
        </div>
      </div>
      
      <footer className="bg-neutral-800 text-white py-12">
        <div className="container">
          <div className="text-center">
            <p className="text-neutral-400">Â© {new Date().getFullYear()} MoveIN. All rights reserved.</p>
          </div>
        </div>
      </footer>
    </div>
  );
};

export default NotFound;
